import React from 'react';
import "./home.css";
import ME from '../../collateral/auguri.png'

const Home = () => {
  return (
    <section className="home section" id='home'>
      <div className="introduction">
        <img className="home-image" src={Home} />
      </div>
    </section>
  )
}

export default Home
